import React, { Component } from 'react';
import AppContext from './AppContext';

class AppProvider extends Component {
  render() {
    return (
      <AppContext.Provider
        value={{
          isMobile: ''
        }}
      >
        {this.props.children}
      </AppContext.Provider>
    );
  }
}

export default AppProvider;
